import { Button, Container, Row, Col } from 'react-bootstrap';

class Welcome extends React.Component {
    render() {
        return (
            <Container>
                <Row>
                    <Col xs={12} md={{ span: 8, offset: 4 }}>
                       Welcome to My Fruit Store 
                    </Col>
                </Row>
            </Container>
        )
    }
}
export default Welcome;
